import React from 'react';
import { MenuItem } from '../';

import './Menu.css';

interface Props {
  items: {
    text: string;
    clicked: (t: string) => unknown;
  }[];
}

export const Menu = (props: Props) => {
  const { items } = props;

  return (
    <nav className="menu__container">

      <MenuItem key={1} text={items[0].text} clicked={items[0].clicked}/>
      <MenuItem key={2} text={items[1].text} clicked={items[1].clicked}/>
    </nav>
  );
}
